import React from "react";
import styled, { keyframes } from "styled-components";

const IntroWrapper = styled.svg`
  width: 100%;
  margin-bottom: 30px;

  path {
    fill: var(--black);
  }

  rect {
    fill: var(--bg);
  }
`;

const EnterAnimation = keyframes`
  0% {
    transform: translateY(20px);
    opacity: 0;
  }

  100% {
    transform: translateY(0%);
    opacity: 1;
  }
`;

const ExitAnimation = keyframes`
    0% {
    transform: scale(1, 1);
  }

  100% {
    transform: scale(1, 0);
  }
`;

const TopLine = styled.g`
  transform: translateY(20px);
  opacity: 0;
  animation: ${EnterAnimation} 0.8s 0.2s ease-in-out forwards;
`;

const BottomLine = styled.g`
  transform: translateY(20px);
  opacity: 0;
  animation: ${EnterAnimation} 0.8s ease-in-out 0.4s forwards;
`;

const TopRect = styled.rect`
  animation: ${ExitAnimation} 0.4s 0.2s ease-in-out forwards;
  transform-origin: bottom;
`;

const BottomRect = styled.rect`
  animation: ${ExitAnimation} 0.4s 0.4s ease-in-out forwards;
  transform-origin: bottom;
`;

